function diePool(){this.numDice=0,this.allObjects=[],this.generatePool=function(t){for(var i=0;5*t>i;i++)this.allObjects.push(new Die(Math.ceil(6*Math.random())))},this.setCurrentCurrentDie=function(t,i){this.allObjects[t]=i},this.addDie=function(t){this.allObjects.push(t)},this.removeDie=function(t){t>-1&&this.allObjects.splice(t,1)},this.emptyDiePool=function(){this.allObjects=[]},this.resetDiePool=function(){this.emptyDiePool()},this.shuffleDice=function(){for(var t=this.allObjects.length-1;t>0;t--){var i=Math.floor(Math.random()*(t+1)),e=this.allObjects[t];this.allObjects[t]=this.allObjects[i],this.allObjects[i]=e}}}